INSERT INTO `medias` VALUES (1,'tt0050083','12 Angry Men','12 Angry Men (1957)','Movie','1957','https://m.media-amazon.com/images/M/MV5BMWU4N2FjNzYtNTVkNC00NzQ0LTg0MjAtYTJlMjFhNGUxZDFmXkEyXkFqcGdeQXVyNjc1NTYyMjg@._V1_Ratio0.6762_AL_.jpg','1957-04-10','1h 36min','Un jeune homme d\'origine modeste est accusé du meurtre de son père et risque la peine de mort. Le jury composé de douze hommes se retire pour délibérer et procède immédiatement à un vote : onze votent coupable, or la décision doit être prise à l\'unanimité. Le juré qui a voté non-coupable, sommé de se justifier, explique qu\'il a un doute et que la vie d\'un homme mérite quelques heures de discussion. Il s\'emploie alors à les convaincre un par un.','Sidney Lumet','Reginald Rose','Henry Fonda, Lee J. Cobb, Martin Balsam','  ',NULL,'Orion-Nova Productions','Etats-Unis','Anglais','9','https://m.media-amazon.com/images/M/MV5BMWU4N2FjNzYtNTVkNC00NzQ0LTg0MjAtYTJlMjFhNGUxZDFmXkEyXkFqcGdeQXVyNjc1NTYyMjg@._V1_Ratio0.6762_AL_.jpg','https://m.media-amazon.com/images/M/MV5BMWU4N2FjNzYtNTVkNC00NzQ0LTg0MjAtYTJlMjFhNGUxZDFmXkEyXkFqcGdeQXVyNjc1NTYyMjg@._V1_Ratio0.6762_AL_.jpg'),(2,'tt0068646','The Godfather','The Godfather (1972)','Movie','1972','https://m.media-amazon.com/images/M/MV5BM2MyNjYxNmUtYTAwNi00MTYxLWJmNWYtYzZlODY3ZTk3OTFlXkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_Ratio0.7046_AL_.jpg','1972-03-24','2h 55min','Le chef d’oeuvre à grand spectacle de Francis Ford Coppola met en vedette Marlon Brando* dans le rôle oscarisé du patriarche de la famille Corleone. Son interprétation légendaire est l’un des grands moments du septième art. Le réalisateur Coppola nous décrit l’inquiétante ascension du clan sicilien et la façon dont la Famille réussit in extremis à conserver sa suprêmatie aux Etats-Unis. Il met magistralement en exergue le parfait équilibre entre des liens familiaux intenses et un affairisme criminel sinistre. D’après le best-seller de Mario Puzo et avec Al Pacino, James Caan et Robert Duvall dans des rôles qui les ont propulsés vers la gloire. Ce film brillant et virulent a recueilli 10 nominations aux Oscars® et fut lauréat de 3 Oscars® dont celui du Meilleur Film en 1972.','Francis Ford Coppola','Mario Puzo, Francis Ford Coppola','Marlon Brando, Al Pacino, James Caan','  ',NULL,'Paramount Pictures, Albert S. Ruddy Productions, Alfran Productions','Etats-Unis','Anglais, italien, Latin','9.2','https://image.tmdb.org/t/p/original/3bhkrj58Vtu7enYsRolD1fZdja1.jpg','https://image.tmdb.org/t/p/original/htuuuEwAvDVECMpb0ltLLyZyDDt.jpg'),(3,'tt0111161','The Shawshank Redemption','The Shawshank Redemption (1994)','Movie','1994','https://m.media-amazon.com/images/M/MV5BMDFkYTc0MGEtZmNhMC00ZDIzLWFmNTEtODM1ZmRlYWMwMWFmXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_Ratio0.6762_AL_.jpg','1994-10-14','2h 22min','En 1947, Andy Dufresne, un jeune banquier, est condamné à la prison à vie pour le meurtre de sa femme et de son amant. Ayant beau clamer son innocence, il est emprisonné à Shawshank, le pénitencier le plus sévère de l’État du Maine. Il y fait la rencontre de Red, un noir désabusé, détenu depuis vingt ans. Commence alors une grande histoire d\'amitié entre les deux hommes...','Frank Darabont','Stephen King, Frank Darabont','Tim Robbins, Morgan Freeman, Bob Gunton','  ',NULL,'Castle Rock Entertainment','Etats-Unis','Anglais','9.3','https://m.media-amazon.com/images/M/MV5BMDFkYTc0MGEtZmNhMC00ZDIzLWFmNTEtODM1ZmRlYWMwMWFmXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_Ratio0.6762_AL_.jpg','https://m.media-amazon.com/images/M/MV5BMDFkYTc0MGEtZmNhMC00ZDIzLWFmNTEtODM1ZmRlYWMwMWFmXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_Ratio0.6762_AL_.jpg'),(4,'tt0468569','The Dark Knight','The Dark Knight (2008)','Movie','2008','https://m.media-amazon.com/images/M/MV5BMTMxNTMwODM0NF5BMl5BanBnXkFtZTcwODAyMTk2Mw@@._V1_Ratio0.6762_AL_.jpg','2008-07-18','2h 32min','Dans ce nouveau volet, Batman augmente les mises dans sa guerre contre le crime. Avec l\'appui du lieutenant de police Jim Gordon et du procureur de Gotham, Harvey Dent, Batman vise à éradiquer le crime organisé qui pullule dans la ville. Leur association est très efficace mais elle sera bientôt bouleversée par le chaos déclenché par un criminel extraordinaire que les citoyens de Gotham connaissent sous le nom de Joker.','Christopher Nolan','Jonathan Nolan, Christopher Nolan, David S. Goyer','Christian Bale, Heath Ledger, Aaron Eckhart','  ',NULL,'Warner Bros., Legendary Entertainment, Syncopy','Etats-Unis, ROYAUME-UNI','Anglais, mandarin','9','https://m.media-amazon.com/images/M/MV5BMTMxNTMwODM0NF5BMl5BanBnXkFtZTcwODAyMTk2Mw@@._V1_Ratio0.6762_AL_.jpg','https://m.media-amazon.com/images/M/MV5BMTMxNTMwODM0NF5BMl5BanBnXkFtZTcwODAyMTk2Mw@@._V1_Ratio0.6762_AL_.jpg'),(5,'tt0071562','The Godfather Part II','The Godfather Part II (1974)','Movie','1974','https://m.media-amazon.com/images/M/MV5BMWMwMGQzZTItY2JlNC00OWZiLWIyMDctNDk2ZDQ2YjRjMWQ0XkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_Ratio0.7046_AL_.jpg','1974-12-18','3h 22min','Depuis la mort de Don Vito Corleone, son fils Michael règne sur la famille. Amené à négocier avec la mafia juive, il perd alors le soutien d\'un de ses lieutenants, Frankie Pentageli. Échappant de justesse à un attentat, Michael tente de retrouver le coupable.','Francis Ford Coppola','Francis Ford Coppola, Mario Puzo','Al Pacino, Robert De Niro, Robert Duvall','  ',NULL,'Paramount Pictures, The Coppola Company, American Zoetrope','Etats-Unis','Anglais, italien, Espagnol, Latin, Sicilienne','9','https://m.media-amazon.com/images/M/MV5BMWMwMGQzZTItY2JlNC00OWZiLWIyMDctNDk2ZDQ2YjRjMWQ0XkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_Ratio0.7046_AL_.jpg','https://m.media-amazon.com/images/M/MV5BMWMwMGQzZTItY2JlNC00OWZiLWIyMDctNDk2ZDQ2YjRjMWQ0XkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_Ratio0.7046_AL_.jpg'),(6,'tt0108052','Schindler\'s List','Schindler\'s List (1993)','Movie','1993','https://m.media-amazon.com/images/M/MV5BNDE4OTMxMTctNmRhYy00NWE2LTg3YzItYTk3M2UwOTU5Njg4XkEyXkFqcGdeQXVyNjU0OTQ0OTY@._V1_Ratio0.6762_AL_.jpg','1994-02-04','3h 15min','Évocation des années de g