les. À moins que Frodon, aidé d\'une Compagnie constituée de Hobbits, d\'Hommes, d\'un Magicien, d\'un Nain, et d\'un Elfe, ne parvienne à emporter l\'Anneau à travers la Terre du Milieu jusqu\'à la Crevasse du Destin, lieu où il a été forgé, et à le détruire pour toujours. Un tel périple signifie s\'aventurer très loin en Mordor, les terres du Seigneur des ténèbres, où est rassemblée son armée d\'Orques maléfiques... La Compagnie doit non seulement combattre les forces extérieures du mal mais aussi les dissensions internes et l\'influence corruptrice qu\'exerce l\'Anneau lui-même.','Peter Jackson','J.R.R. Tolkien, Fran Walsh, Philippa Boyens','Elijah Wood, Ian McKellen, Orlando Bloom','  ',NULL,'New Line Cinema, WingNut Films, The Saul Zaentz Company','Nouvelle-Zélande, Etats-Unis','Anglais, Sindarin','8.8','https://image.tmdb.org/t/p/original/6oom5QYQ2yQTMJIbnvbkBL9cHo6.jpg','https://image.tmdb.org/t/p/original/tqj7NKj11keFuLzPsBDMUq2dOUO.jpg'),(10,'tt0060196','The Good, the Bad and the Ugly','The Good, the Bad and the Ugly (1966)','Movie','1966','https://m.media-amazon.com/images/M/MV5BNjJlYmNkZGItM2NhYy00MjlmLTk5NmQtNjg1NmM2ODU4OTMwXkEyXkFqcGdeQXVyMjUzOTY1NTc@._V1_Ratio0.6762_AL_.jpg','1967-12-29','2h 58min','Pendant la Guerre de Sécession, Tuco et Joe se lancent à la recherche d\'un coffre contenant 200 000 dollars en pièces d\'or volés à l\'armée sudiste. Ayant des indices complémentaires sur la cache, chacun a besoin de l\'autre. Mais un troisième homme entre dans la course : Sentenza, un tueur qui ne recule devant rien pour parvenir à ses fins.','Sergio Leone','Luciano Vincenzoni, Sergio Leone, Agenore Incrocci','Clint Eastwood, Eli Wallach, Lee Van Cleef','  ',NULL,'Produzioni Europee Associate (PEA), Arturo González Producciones Cinematográficas, Constantin Film','Italie, Espagne, Allemagne de l\'Ouest','italien, Anglais','8.8','https://image.tmdb.org/t/p/original/bX2xnavhMYjWDoZp1VM6VnU1xwe.jpg','https://image.tmdb.org/t/p/original/x4biAVdPVCghBlsVIzB6Nmb