entre 1973-1974 par Peter Batty, Jeremy Isaacs et Hugh Ragett sous le titre The World at War pour Thames Television (ITV).Cette série de 34 épisodes, principalement narrée par Jean Desailly (Laurence Olivier dans la version originale anglaise), présente un montage de films d\'archives sur la montée des totalitarismes en Allemagne et au Japon dans les années 1930, ainsi que les différents théâtres d\'opération du deuxième conflit mondial en Europe, Afrique et Asie.La bande originale a été composée par Carl Davis.En 2000, à la suite d\'un sondage organisé par le British Film Institute (BFI), cette série a été classée au 19e rang des 100 meilleurs programmes de la télévision britannique.','Divers','Divers','Laurence Olivier, Albert Speer, Anthony Eden','Hugh Raggett, John Pett, Neal Ascherson',1,'Imperial War Museum, Thames Television','ROYAUME-UNI','Anglais, Allemand, Français, Japonais','9.2','https://m.media-amazon.com/images/M/MV5BZTIwOWEyMjctMjQwNS00ODZiLThmMWEtYWQ1OWFiYzQ2OWYwXkEyXkFqcGdeQXVyNjAwNDUxODI@._V1_Ratio0.6762_AL_.jpg','https://m.media-amazon.com/images/M/MV5BZTIwOWEyMjctMjQwNS00ODZiLThmMWEtYWQ1OWFiYzQ2OWYwXkEyXkFqcGdeQXVyNjAwNDUxODI@._V1_Ratio0.6762_AL_.jpg'),(54,'tt1355642','Fullmetal Alchemist: Brotherhood','Fullmetal Alchemist: Brotherhood (TV Series 2009–2010)','TVSeries','2009','https://m.media-amazon.com/images/M/MV5BNTM4MzMxMWItYzc3NC00ODY0LTg0M2MtYjg4NDg0ZjM0MjdiXkEyXkFqcGdeQXVyNjAwNDUxODI@._V1_Ratio0.7046_AL_.jpg','2009-04-09','2 Saison(s)','Dans le monde surnaturel de cet anime, les frères Edward et Alphonse combattent des forces malfaisantes pour récupérer leurs corps après avoir souffert dans leur chair.','Divers','Divers','Kent Williams, Iemasa Kayumi, Matthew Leonhart','Hiromu Arakawa',2,'Bones, Square Enix Company','Japon','Japonais','9.1','https://m.media-amazon.com/images/M/MV5BNTM4MzMxMWItYzc3NC00ODY0LTg0M2MtYjg4NDg0ZjM0MjdiXkEyXkFqcGdeQXVyNjAwNDUxODI@._V1_Ratio0.7046_AL_.jpg','https://m.media-amazon.com/images/M/MV5BNTM4MzMxMWItYzc3NC00ODY0LTg0M2MtYjg4NDg0ZjM0MjdiXkEyXkFqcGdeQXVyNjAwNDUxODI@._V1_Ratio0.7046_AL_.jpg'),(56,'tt1533395','Life','Life (TV Series 2009–2009)','TVSeries','2009','https://m.media-amazon.com/images/M/MV5BNjJhMTAxZjYtNWZkYy00Nzg1LTlkYjItZTNhZWRjNzkxMDg3XkEyXkFqcGdeQXVyNTA4NzY1MzY@._V1_Ratio0.7046_AL_.jpg','2009-10-12','1 Saison(s)','la Nature comme vous ne l’avez jamais vue !!!Cette réalisation à grand succès dont les images sont à couper le souffle est aussi émouvante que divertissante, en dix épisodes aux surprenantes révélations, cette série documentaire porte à l’écran 130 incroyables histoires dont certaines sont inédites.Découvrez la surprenante diversité de la vie sur terre et les tactiques tout aussi spectaculaires et extraordinaires que les animaux comme les plantes ont développé pour rester en vie.Observez des créatures confrontées à des conditions extrêmes, repoussant les limites de leur comportement pour relever les défis de leurs adversaires et de leur environnement.Admirez des techniques cinématographiques avant-gardistes aux séquences étonnamment belles et sans précédent dont certaines filmées à la vitesse de 8000 images par seconde: des oiseaux courant et dansant à la surface de l’eau dans des parades amoureuses éblouissantes et complexes, des poissons déjouant leurs prédateurs en utilisant leurs nageoires pour prendre leur envol…Sur une magnifique musique de George Fenton (récompensé aux Oscars) compositeur de la musique des documentaires « Planète Terre » et « Planète bleue », plus de quatre années de préparation, plus de 3000 jours de tournage sur tous les continents et dans tous les habitats ont été nécessaires pour réaliser cette magnifique série documentaire.','Divers','Divers','Oprah Winfrey, David Attenborough, Doug Allan','Martha Holmes, Sara Edelson, Paul Spillenger',1,'British Broadcasting Corporation (BBC), Discovery Channel, SKAI','ROYAUME-UNI, Etats-Unis, Grèce, Italie, Allemagne','Anglais','9.1','https://m.media-amazon.com/images/M/MV5BNjJhMTA