res sont des androïdes à apparence humaine créés pour donner l\'illusion et offrir du dépaysement aux clients. Pour ces derniers, Westworld est l\'occasion de laisser libre-cours à leurs fantasmes. Cet univers bien huilé est mis en péril lorsqu\'à la suite d\'une mise à jour, quelques robots commencent à adopter des comportements imprévisibles, voire erratiques. En coulisses, l\'équipe, qui tire les ficelles de ce monde alternatif, s\'inquiète de ces incidents de plus en plus nombreux. Les enjeux du programme Westworld étant énormes, la Direction ne peut se permettre une mauvaise publicité qui ferait fuir ses clients. Que se passe-t-il réellement avec les androïdes ré-encodés ?','Divers','Divers','Evan Rachel Wood, Jeffrey Wright, Ed Harris','Lisa Joy, Jonathan Nolan',4,'Bad Robot, Jerry Weintraub Productions, Kilter Films','Etats-Unis','Anglais','8.5','https://image.tmdb.org/t/p/original/8MfgyFHf7XEboZJPZXCIDqqiz6e.jpg','https://image.tmdb.org/t/p/original/rX5hvSRB2k4YoIvRg6Zky52rWk0.jpg'),(84,'tt0816692','Interstellar','Interstellar','Movie',' _ ','https://m.media-amazon.com/images/M/MV5BZjdkOTU3MDktN2IxOS00OGEyLWFmMjktY2FiMmZkNWIyODZiXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_Ratio0.6763_AL_.jpg',' _ ',' _ ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'8.6',NULL,NULL),(86,'tt0120689','The Green Mile','The Green Mile','Movie',' _ ','https://m.media-amazon.com/images/M/MV5BMTUxMzQyNjA5MF5BMl5BanBnXkFtZTYwOTU2NTY3._V1_Ratio0.6763_AL_.jpg',' _ ',' _ ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'8.6',NULL,NULL),(94,'tt0099674','The Godfather Part III','The Godfather Part III','Movie',' _ ','https://m.media-amazon.com/images/M/MV5BNWFlYWY2YjYtNjdhNi00MzVlLTg2MTMtMWExNzg4NmM5NmEzXkEyXkFqcGdeQXVyMDk5Mzc5MQ@@._V1_Ratio0.6763_AL_.jpg',' _ ',' _ ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'7.6',NULL,NULL),(102,'tt1345836','The Dark Knight Rises','The Dark Knight Rises','Movie',' _ ','https://m.media-amazon.com/images/M/MV5BMTk4ODQzNDY3Ml5BMl5BanBnXkFtZTcwODA0NTM4Nw@@._V1_Ratio0